import React, { useState } from "react";
import classNames from "classnames";

export default function FAQ({ title, content }) {
  const [isActive, setIsActive] = useState(false);

  const handleClick = () => {
    setIsActive(!isActive);
  };

  const handleMouseEnter = (event) => {
    if (!isActive) {
      event.target.style.color = "#F24E1E";
    }
  };

  const handleMouseLeave = (event) => {
    if (!isActive) {
      event.target.style.color = "";
    }
  };

  return (
    <div className="faq">
      <div className="faq-title" style={{ fontSize: "50px", color: "orange", marginBottom: "20px" }}>
        FAQ
      </div>
      <div className="faq-section">
        <div
          className={classNames("faq-item", {
            active: isActive,
          })}
          style={{
            marginBottom: "20px",
          }}
        >
          <button
            className="faq-header"
            onClick={handleClick}
            style={{
              padding: "10px",
              fontWeight: "bold",
              cursor: "pointer",
              color: isActive ? "#F24E1E" : "",
            }}
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            How many donations can I make?
          </button>
          {isActive && <div className="faq-line"></div>}
          {isActive && (
            <div
              className="faq-body"
              style={{
                padding: "10px",
              }}
            >
              Vitae congue eu consequat ac felis placerat vestibulum lectus mauris ultrices. Cursus sit amet dictum sit amet justo donec enim diam porttitor lacus luctus accumsan tortor posuere.
            </div>
          )}
        </div>
        <div className="faq-line" style={{ backgroundColor: "#ccc", height: "1px", marginBottom: "20px" }}></div>
        <div
          className={classNames("faq-item", {
            active: isActive,
          })}
          style={{
            marginBottom: "20px",
          }}
        >
          <button
            className="faq-header"
            onClick={handleClick}
            style={{
              padding: "10px",
              fontWeight: "bold",
              cursor: "pointer",
              color: isActive ? "#F24E1E" : "",
            }}
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            What is included in the date package?
          </button>
          {isActive && <div className="faq-line"></div>}
          {isActive && (
            <div
              className="faq-body"
              style={{
                padding: "10px",
              }}
            >
              Answer 1
            </div>
          )}
        </div>
        <div className="faq-line" style={{ backgroundColor: "#ccc", height: "1px", marginBottom: "20px" }}></div>
        <div
          className={classNames("faq-item", {
            active: isActive,
          })}
          style={{
            marginBottom: "20px",
          }}
        >
          <button
            className="faq-header"
            onClick={handleClick}
            style={{
              padding: "10px",
              fontWeight: "bold",
              cursor: "pointer",
              color: isActive ? "#F24E1E" : "",
            }}
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            How do I become a volunteer?
          </button>
          {isActive && <div className="faq-line"></div>}
          {isActive && (
            <div
              className="faq-body"
              style={{
                padding: "10px",
              }}
            >
              Answer 2
            </div>
          )}
        </div>
        <div className="faq-line" style={{ backgroundColor: "#ccc", height: "1px", marginBottom: "20px" }}></div>
        <div
          className={classNames("faq-item", {
            active: isActive,
          })}
          style={{
            marginBottom: "20px",
          }}
        >
          <button
            className="faq-header"
            onClick={handleClick}
            style={{
              padding: "10px",
              fontWeight: "bold",
              cursor: "pointer",
              color: isActive ? "#F24E1E" : "",
            }}
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            How are the dates scheduled?
          </button>
          {isActive && <div className="faq-line"></div>}
          {isActive && (
            <div
              className="faq-body"
              style={{
                padding: "10px",
              }}
            >
              Answer 3
            </div>
          )}
        </div>
        <div className="faq-line" style={{ backgroundColor: "#ccc", height: "1px", marginBottom: "20px" }}></div>
        <div
          className={classNames("faq-item", {
            active: isActive,
          })}
          style={{
            marginBottom: "20px",
          }}
        >
          <button
            className="faq-header"
            onClick={handleClick}
            style={{
              padding: "10px",
              fontWeight: "bold",
              cursor: "pointer",
              color: isActive ? "#F24E1E" : "",
            }}
            onMouseEnter={handleMouseEnter}
            onMouseLeave={handleMouseLeave}
          >
            Can I donate and not go on a date?
          </button>
          {isActive && <div className="faq-line"></div>}
          {isActive && (
            <div
              className="faq-body"
              style={{
                padding: "10px",
              }}
            >
              Answer 3
            </div>
          )}
        </div>
      </div>
    </div>
  );
}
